import "./Home.css";
import Header from "../Component/Header";
import { useState } from "react";
import { callApi } from "../services/callApi";

const Home = () => {
    const [text, setText] = useState("");
    const [users, setUsers] = useState([])
    const  search=()=>{
     callApi(text).then(res => setUsers(res.data.items)).catch(console.log("FETCH ERROR"))
    }

    return (
        <>
            <Header/>
                <div className='form-container'>
                    <input className='search-input' value={text}
                    onChange={(e) => setText(e.target.value)}
                    placeholder='Search Users...'></input>
                    <button className='submit-button' 
                    onClick={search}
                     >Submit</button>
                     <button className="clearbutton" onClick={D} >Clear</button>
                </div>
                <div>
                    <div className="card">
                        <div className="bodycard">
                            <img href=''></img>
                            <button>More</button>
                        </div>
                    </div>
                </div>
            {
                users && users.map((item)=>{
                   return  (<div key={item.id}>{item.login}</div>)
                })
            }

        </>
    );
};

export default Home;
